The package manager supports configuration constants that allow for conditional configuration within a manifest through the top-level conditional property. The matching options are combined and overriden properly in top-down sequence, including the program sources and the package dependencies. The conditions in conditional support a minimal conditional language: constant — If constant is present constant=value — If constant is equals "value" !expression — If condition is false (expression) — Parenthesized condition primaryExpression && primaryExpression — If conditions are true primaryExpression || primaryExpression — If one condition is true The root condition is in one of the forms: always if (condition) else if (condition) else Here is an example package manifest using the conditional setting: package.json { "conditional": [ ["always", { "compilerOptions": { "includeSources": ["src/base"] } }], ["if (air::target=ios)", { "compilerOptions": { "includeSources": ["src/platform/ios"] } }], ["else", { "compilerOptions": { "includeSources": ["src/platform/unsupported"] } }], ["always", { "compilerOptions": { "includeSources": ["src/facade"] } }] ]
} Here are example JetPM commands passing configuration constants: jetpm build --define someConstant
jetpm build --define air::target=ios

